import { Fragment } from "react/cjs/react.production.min";
import classes from "./Header.module.css";

const Header = (props) => {
  return (
    <Fragment>
      <header className={classes.Header}></header>
      <div className={classes.imager}>
        <imge />
      </div>
    </Fragment>
  );
};

export default Header;
